import React, { useEffect } from "react";
import Footer from "../../components/footer/footer";
import { Barrinha } from "../../components/sidebar";
// import { Barrinha } from "../../components/sidebar";
// não preciso importar mais
import Avatar from "@material-ui/core/Avatar";
import Button from "@material-ui/core/Button";
import CssBaseline from "@material-ui/core/CssBaseline";
import TextField from "@material-ui/core/TextField";
import FormControlLabel from "@material-ui/core/FormControlLabel";
import Checkbox from "@material-ui/core/Checkbox";
import Grid from "@material-ui/core/Grid";
import Box from "@material-ui/core/Box";
import LockOutlinedIcon from "@material-ui/icons/LockOutlined";
import Typography from "@material-ui/core/Typography";
import Container from "@material-ui/core/Container";
import Paper from "@material-ui/core/Paper";
import { makeStyles, createStyles, Theme } from "@material-ui/core/styles";
import { Navbartest } from "../../components/navbartest/navbartest";
import logo from "../../assets/img/COD_LOGOvs2.png";
import "./style.css";
import AOS from "aos";
import "aos/dist/aos.css";

const useStyles = makeStyles((theme: Theme) =>
  createStyles({
    root: {
      flexGrow: 1,
    },
    paper: {
      padding: theme.spacing(2),
      textAlign: "center",
      color: theme.palette.text.secondary,
    },
  })
);

function Equip() {
  const classes = useStyles();
  useEffect(() => {
    AOS.init({ duration: 3000 });
    AOS.refresh();
  }, []);
  return (
    <>
      <Navbartest />
      {/* <Barrinha /> */}
      {/* <Footer /> */}
      <Grid container data-aos="fade-left" alignContent="center" spacing={3}>
        <Grid
          item
          xs={4}
          sm={4}
          md={4}
          lg={4}
          xl={4}
          style={{ background: "#DFD211" }}
        >
          <img src={logo} alt=""></img>{" "}
        </Grid>
        <Grid
          item
          xs={4}
          sm={4}
          md={4}
          lg={4}
          xl={4}
          style={{ background: "#11DF33" }}
          data-aos="fade-down"
        >
          <img src={logo} alt=""></img>{" "}
        </Grid>
        <Grid
          item
          xs={4}
          sm={4}
          md={4}
          lg={4}
          xl={4}
          style={{ background: "#4d79ff" }}
          data-aos="fade-right"
        >
          <img src={logo} alt=""></img> <h1>teste</h1>
        </Grid>
      </Grid>
      <div  className="App">
      <Grid container spacing={3}>
        <Grid item xs={6}>
          <div style={{background:randomColor()}}>Hooray something is here!</div>
        </Grid>
        <Grid item xs={6}>
          <div style={{background:randomColor()}}> Hooray something is too! </div>
        </Grid>
        <Grid item xs={4}>
          <div style={{background:randomColor()}}> Another item! </div>
        </Grid>
        <Grid item xs={4}>
          <div style={{background:randomColor()}}> Showing off rows! </div>
        </Grid>
        <Grid item xs={4}>
          <div style={{background:randomColor()}}> Last item! </div>
        </Grid>
      </Grid>
    </div>
  );
}


